import React, {useState, useEffect} from "react";
import axios from "axios";
import Product from "./UI/product/Product";
import classes from "./UI/product/Product.module.css";

function DataFetching() {
    const [products, setProducts] = useState([]);

    useEffect(() => {
        axios.get('http://localhost:8888/shop-sw/back-end/public/')
            .then(response => {
                setProducts(response.data)
            });
    });

    if(products[0].name != null) {
        console.log('1');
    } else {
        console.log('a');
    }

    return (
        <div className={classes.productList}>
            {products.map(product => <Product id={product.id} sku={product.sku} name={product.name} price={product.price} productType={product.productType}/>)}
        </div>
    )
}

export default DataFetching
